import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Header from './components/Header/Header';
import FeedbackLogin from './components/Login/FeedbackLogin';
import FeedbackForm from './components/Feedback/FeedbackForm';
import FeedbackSubmitted from './components/FeedbackSubmitted/FeedbackSubmitted';
import Admin from './components/Admin/Admin';
import AddCourseData from './components/Admin/AddCourseData';
import AddStudentData from './components/Admin/AddStudentData';
import FeedbackViewer from './components/Admin/FeedbackViewer';
import AdminLanding from './components/Admin/AdminLanding';
import StudentReports from './components/Admin/StudentReports';
import StudentReportView from './components/Admin/StudentReportView'; // Import the new component
import Footer from './components/Footer/Footer'; // Import the Footer component
import './App.css';

function App() {
    return (
        <Router>
            <div className="app-container">
                <div className="content"> {/* Wrap Routes in a content div */}
                    <Switch>
                        <Route path="/" component={FeedbackLogin} />
                        <Route
                            path="/feedback"
                            render={() => (
                                <>
                                    <Header />
                                    <FeedbackForm />
                                </>
                            )}
                        />
                        <Route
                            path="/feedback-submitted"
                            render={() => (
                                <>
                                    <Header />
                                    <FeedbackSubmitted />
                                </>
                            )}
                        />
                        <Route
                            path="/admin"
                            render={() => (
                                <>
                                    <Header />
                                    <AdminLanding />
                                </>
                            )}
                        />
                        <Route
                            path="/admin/add-courses"
                            render={() => (
                                <>
                                    <Header />
                                    <AddCourseData />
                                </>
                            )}
                        />
                        <Route
                            path="/admin/add-students"
                            render={() => (
                                <>
                                    <Header />
                                    <AddStudentData />
                                </>
                            )}
                        />
                        <Route
                            path="/admin/feedback-viewer"
                            render={() => (
                                <>
                                    <Header />
                                    <FeedbackViewer />
                                </>
                            )}
                        />
                        <Route
                            path="/admin/student-reports"
                            render={() => (
                                <>
                                    <Header />
                                    <StudentReports />
                                </>
                            )}
                        />
                        <Route path="/student-report/:studentId" component={StudentReportView} /> {/* Ensure this route exists */}
                        <Route
                            path="/admin/faculty-reports"
                            render={() => (
                                <>
                                    <Header />
                                    <Admin />
                                </>
                            )}
                        />
                        <Route
                            path="*"
                            render={() => (
                                <>
                                    <Header />
                                    <div>404 - Page Not Found</div>
                                </>
                            )}
                        />
                    </Switch>
                </div>
                <Footer /> {/* Always display the footer */}
            </div>
        </Router>
    );
}

export default App;
